import { Button, Grid, Stack, useTheme, useMediaQuery } from "@mui/material";

export const Profile = () => {
  const theme = useTheme();
  const matches = useMediaQuery(theme.breakpoints.up("md"));
  const widthCalc = `calc(100vw - ${matches ? "200" : "75"}px)`;
  return (
    <Grid
      width={widthCalc}
      justifyContent={"center"}
      alignItems={"center"}
      container
    >
      <Grid sm={8} item container justifyContent={"center"} direction={"row"}>
        <Grid item>
          <svg>
            <circle cx={"50%"} cy={"50%"} r={"75px"} fill={"#2196f3"} />
          </svg>
        </Grid>
        <Grid item>
          <Stack></Stack>
        </Grid>
      </Grid>
      <Grid sm={4} item container justifyContent={"center"}>
        <Button>Right Nav</Button>
      </Grid>
    </Grid>
  );
};
